script: |
  super -f tsv -I q9410.sql | sort > q9410.out

vector: true

inputs:
  - name: q9410.sql
    data: |
      SELECT DISTINCT cor0.col1 * cor0.col0 FROM tab0 AS cor0 WHERE - col2 + cor0.col1 NOT IN ( col1 * col0 * col2 + col1 ) OR NOT NULL IN ( - col1 * col0 - - col1 );
  - name: tab0

outputs:
  - name: q9410.out
    data: |
      2064
      3395
      8099
